             [color=#1b67a5]█▄ █ ▀█▀    
             █ ▀█     █ [/color]    [head=2]Cryogenics Setup Instructions[/head]
          ─────────────────────────────────────────

        Setting up the cryo tubes is actually fairly simple once you learn! For the two filters that you see near the table... set one of them to filter out carbon dioxide, and the other for nitrous oxide. 


        On the other side of the piping there is a gas pump. Just turn it on, a pressure of 101.3 kpa is ideal.


        Next for the temperatures... you can set the freezer unit to 150k. Most cryo medicines need 213k to work in a patient, with a select few needing 150k.

        The heating unit can be set to 350k for when the use of pyrogenics is needed. Then you are all set, just turn one or the other on as needed!


        The lockers inbetween the cryo tubes are for items that are should be kept secured if they need to be removed from a person
