             [bold]Welcome Aboard our dearly Terra Station, Chief Engineer![/bold]
              Nanotrasen wishes that you will enjoy your shift at this beautiful station! This station is equipped with an AME with a base of six cores and a TEG. We also thought you'd be interested with seeing the schematics of the original plan of the station. Our designer wanted to do something a little different and add in the PA system as well, however we had to unfortunately discard that design as we strictly keep each station to having two different engines to power it.

